import colors from './colors'

const transactionHistoryItem = {
  variant: {
    sender: {
      background: colors.yellow,
    },
    recipient: {
      background: colors.purple,
    },
  },
  width: 16,
  height: 16,
  borderRadius: 8,
  marginRight: 6,
}

export default transactionHistoryItem
